            <ul className={style.quotes}>
              <li>
                <p className={style.commonTitle}>
                  Radar cut our fraud rates by over 70% without any
                  configuration, saving our pizzerias thousands of dollars every
                  month and allowing us to focus on delivering the best local
                  pizza experience possible.
                </p>
                <p className={style.commonUppercaseText}>Finn Borge</p>
                <p className={style.commonText}>Product Manager</p>
              </li>
              <li>
                <p className={style.commonTitle}>
                  Radar dramatically reduced manual review work and saved
                  Teespring creators from shipping t-shirts to fraudulent
                  customers.
                </p>
                <p className={style.commonUppercaseText}>Lee Edwards</p>
                <p className={style.commonText}>VP of Engineering</p>
              </li>
              <li>
                <p className={style.commonTitle}>
                  Our team protects the Postmates platform from fraud while
                  still providing a great customer experience. Radar hums in the
                  background on every transaction and Radar’s models have been
                  very helpful for separating good transactions from&nbsp;bad.
                </p>
                <p className={style.commonUppercaseText}>Jeff Fong</p>
                <p className={style.commonText}>Product Lead, Risk Team</p>
              </li>
              <li>
                <p className={style.commonTitle}>
                  Radar’s related payments feature helped our fraud team quickly
                  spot a nuanced fraud ring and avoid significant potential
                  loss. It’s been a great asset in our fraud
                  detection&nbsp;arsenal.
                </p>
                <p className={style.commonUppercaseText}>Alison Cleggett</p>
                <p className={style.commonText}>Head of Risk and Compliance</p>
              </li>
              <li>
                <p className={style.commonTitle}>
                  Radar automatically helped Watsi prevent more than $40M in
                  fraudulent donations over just a two-month&nbsp;span.
                </p>
                <p className={style.commonUppercaseText}>Thomas Bukowski</p>
                <p className={style.commonText}>Co-founder</p>
              </li>
            </ul>
